export default function QuestionsBox() {
    return (
        <div className='qbox'>
            <div className="question">waa kuma qofkii ugu horeeyay ee sab ku qadeeya?</div>
            <div className='answers '>
             <div className="answer">cunaaye</div>
             <div className="answer correct">cabaaye</div>
              <div className="answer">laqaaye</div>
               <div className="answer wrong">tufaaye</div>
            </div>
           
            
        </div>
    )
}
